import React, { useState } from 'react';
import { uploadMemory } from './api';

function MemoryUploader() {
    const [file, setFile] = useState(null);
    const [title, setTitle] = useState('');
    const [message, setMessage] = useState('');
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(false);

    const handleUpload = async () => {
        setMessage('');
        setError('');

        if (!file) {
            setError('Please select a file');
            return;
        }

        if (!title.trim()) {
            setError('Please enter a title');
            return;
        }

        setLoading(true);
        try {
            const timestamp = new Date().toISOString();
            const formData = new FormData();
            formData.append('file', file);
            formData.append('title', title);
            formData.append('timestamp', timestamp);

            const result = await uploadMemory(formData);
            const formattedTime = new Date(timestamp).toLocaleString();
            setMessage(`"${title}" uploaded successfully at ${formattedTime}`);
            setTitle('');
            setFile(null);
        } catch (err) {
            setError('Upload failed. Please try again.');
        } finally {
            setLoading(false);
        }
    };

    // Clean, minimal styling
    const containerStyle = {
        padding: '24px',
        backgroundColor: '#fff',
        borderRadius: '8px',
        boxShadow: '0 2px 12px rgba(0,0,0,0.08)',
        maxWidth: '500px',
        margin: '0 auto'
    };

    const headerStyle = {
        marginTop: 0,
        marginBottom: '24px',
        color: '#2d3748',
        fontSize: '1.5rem',
        fontWeight: 600
    };

    const formGroupStyle = {
        marginBottom: '20px'
    };

    const labelStyle = {
        display: 'block',
        marginBottom: '8px',
        fontWeight: 500,
        color: '#4a5568'
    };

    const inputStyle = {
        width: '100%',
        padding: '10px 12px',
        border: '1px solid #e2e8f0',
        borderRadius: '4px',
        fontSize: '1rem',
        boxSizing: 'border-box'
    };

    const fileInfoStyle = {
        display: 'flex',
        justifyContent: 'space-between',
        padding: '10px 12px',
        border: '1px solid #e2e8f0',
        borderRadius: '4px',
        backgroundColor: '#f8fafc',
        fontSize: '0.9rem',
        color: '#4a5568',
        marginTop: '8px'
    };

    const buttonStyle = {
        width: '100%',
        padding: '12px',
        backgroundColor: '#4299e1',
        color: 'white',
        border: 'none',
        borderRadius: '4px',
        fontSize: '1rem',
        fontWeight: 500,
        cursor: 'pointer',
        marginTop: '8px',
        opacity: loading ? 0.7 : 1
    };

    const messageStyle = {
        marginTop: '16px',
        padding: '12px',
        borderRadius: '4px',
        fontSize: '0.95rem'
    };

    const successStyle = {
        ...messageStyle,
        backgroundColor: '#f0fff4',
        border: '1px solid #c6f6d5',
        color: '#2f855a'
    };

    const errorStyle = {
        ...messageStyle,
        backgroundColor: '#fff5f5',
        border: '1px solid #fed7d7',
        color: '#c53030'
    };

    return (
        <div style={containerStyle}>
            <h2 style={headerStyle}>Upload Memory</h2>
            
            <div style={formGroupStyle}>
                <label style={labelStyle}>Memory Title</label>
                <input 
                    type="text"
                    value={title}
                    onChange={(e) => setTitle(e.target.value)}
                    placeholder="Enter memory title"
                    style={inputStyle}
                    disabled={loading}
                />
            </div>
            
            <div style={formGroupStyle}>
                <label style={labelStyle}>Memory File</label>
                <input 
                    type="file" 
                    onChange={(e) => setFile(e.target.files[0])}
                    disabled={loading}
                    style={{ width: '100%' }}
                />
                {file && (
                    <div style={fileInfoStyle}>
                        <span>{file.name}</span>
                        <span>{(file.size / 1024 / 1024).toFixed(2)} MB</span>
                    </div>
                )}
            </div>
            
            <button 
                onClick={handleUpload}
                style={buttonStyle}
                disabled={loading}
            >
                {loading ? 'Uploading...' : 'Upload Memory'}
            </button>

            {message && <div style={successStyle}>{message}</div>}
            {error && <div style={errorStyle}>{error}</div>}
        </div>
    );
}

export default MemoryUploader;
